const path = require('path');
const fs = require('fs');

module.exports = {
  'init': function(browser) {
    browser
      .url('file://' + path.join(__dirname, 'index.html'))
      .waitForElementVisible('body', 1000)
      .pause(20)
      .moveToElement('canvas', 20, 20)
      .mouseButtonDown(1)
      .mouseButtonUp(1)
      .assert.value('#base64', '0,data:image/png;base64,')
      .mouseButtonDown(2)
      .mouseButtonUp(2)
      .assert.value('#base64', '[1,{"v":10,"u":2},{"v":-110,"u":2},{"v":10,"u":2},{"v":-110,"u":2},{"v":0,"u":0},{"v":0,"u":0},{"v":0,"u":1},{"v":0,"u":1},10,-110,10,-110,200,200,0,0]')
      .moveToElement('canvas', 110, 110)
      .mouseButtonDown(0)
      .moveToElement('canvas', 130, 120)
      .pause(20)
      .mouseButtonUp(0)
      .mouseButtonDown(1)
      .mouseButtonUp(1)
      .assert.value('#base64', '2,')
      .mouseButtonDown(2)
      .mouseButtonUp(2)
      .assert.value('#base64', '[3,{"v":10,"u":2},{"v":-130,"u":2},{"v":10,"u":2},{"v":-120,"u":2},{"v":0,"u":0},{"v":0,"u":0},{"v":0,"u":1},{"v":0,"u":1},10,-130,10,-120,220,210,0,0]')
      .moveToElement('canvas', 130, 120)
      .mouseButtonDown(0)
      .moveToElement('canvas', 150, 130)
      .pause(20)
      .mouseButtonUp(0)
      .mouseButtonDown(1)
      .mouseButtonUp(1)
      .assert.value('#base64', '4,')
      .mouseButtonDown(2)
      .mouseButtonUp(2)
      .assert.value('#base64', '[5,{"v":10,"u":2},{"v":-150,"u":2},{"v":10,"u":2},{"v":-130,"u":2},{"v":0,"u":0},{"v":0,"u":0},{"v":0,"u":1},{"v":0,"u":1},10,-150,10,-130,240,220,0,0]')
      .keys(browser.Keys.META)
      .keys('z')
      .keys(browser.Keys.NULL)
      .pause(20)
      .mouseButtonDown(1)
      .mouseButtonUp(1)
      .assert.value('#base64', '6,')
      .mouseButtonDown(2)
      .mouseButtonUp(2)
      .assert.value('#base64', '[7,{"v":10,"u":2},{"v":-130,"u":2},{"v":10,"u":2},{"v":-120,"u":2},{"v":0,"u":0},{"v":0,"u":0},{"v":0,"u":1},{"v":0,"u":1},10,-130,10,-120,220,210,0,0]')
      .keys(browser.Keys.META)
      .keys('z')
      .keys(browser.Keys.NULL)
      .pause(20)
      .mouseButtonDown(1)
      .mouseButtonUp(1)
      .assert.value('#base64', '8,')
      .mouseButtonDown(2)
      .mouseButtonUp(2)
      .assert.value('#base64', '[9,{"v":10,"u":2},{"v":-110,"u":2},{"v":10,"u":2},{"v":-110,"u":2},{"v":0,"u":0},{"v":0,"u":0},{"v":0,"u":1},{"v":0,"u":1},10,-110,10,-110,200,200,0,0]')
      .keys(browser.Keys.META)
      .keys(browser.Keys.SHIFT)
      .keys('z')
      .keys(browser.Keys.NULL)
      .pause(20)
      .mouseButtonDown(1)
      .mouseButtonUp(1)
      .assert.value('#base64', '10,')
      .mouseButtonDown(2)
      .mouseButtonUp(2)
      .assert.value('#base64', '[11,{"v":10,"u":2},{"v":-130,"u":2},{"v":10,"u":2},{"v":-120,"u":2},{"v":0,"u":0},{"v":0,"u":0},{"v":0,"u":1},{"v":0,"u":1},10,-130,10,-120,220,210,0,0]')
      .keys(browser.Keys.META)
      .keys(browser.Keys.SHIFT)
      .keys('z')
      .keys(browser.Keys.NULL)
      .pause(20)
      .mouseButtonDown(1)
      .mouseButtonUp(1)
      .assert.value('#base64', '12,')
      .mouseButtonDown(2)
      .mouseButtonUp(2)
      .assert.value('#base64', '[13,{"v":10,"u":2},{"v":-150,"u":2},{"v":10,"u":2},{"v":-130,"u":2},{"v":0,"u":0},{"v":0,"u":0},{"v":0,"u":1},{"v":0,"u":1},10,-150,10,-130,240,220,0,0]')
      .end();
  }
};
